                        <p class=""desc"">Không có một <strong>shop hoa</strong> nào tốt hơn để bạn lựa chọn cho một <strong>dịch vụ điệ");
                    WriteLiteral(@"n hoa</strong> chuyên nghiệp như shop hoa tươi Hoayeuthuong.com. Bằng tất cả niềm đam mê và tận tâm, Hoayeuthuong.com luôn chọn những bông hoa tươi nhất và sáng tạo lên những mẫu hoa tuyệt vời để chuyển đến người thân yêu của bạn cùng với những lời chúc tốt đẹp. Với hơn 1<strong>50.000 điện hoa</strong> được chúng tôi chuyển trong năm qua là một sự khởi đầu cho sự tin tưởng tuyệt vời. Ngoài các dịch vụ về hoa tươi như: hoa sinh nhật, hoa chúc mừng, hoa chia buồn và shop hoa chúng tôi hiểu được thêm nhu cầu của bạn, chúng tôi có liên kết với các hãng có uy tín để cung cấp thêm các dịch vụ như: bánh sinh nhật, Chocolate, Gấu bông, kẹo ngọt, trái cây...</p>
                        <h3>Cam kết dịch vụ hoa tươi tuyệt vời nhất, giao hoa nhanh nhất, giá tốt nhất, chất lượng hoa tốt nhất.</h3>
                        <p class=""desc"">Với sự liên tục cải tiến quy trình, shop hoa tươi Hoayeuthuong.com nỗ lực đáp ứng trong vòng 2 giờ sẽ giao hoa cho người nhận, chúng tôi là một số ít công ty phục vụ dịch vụ điện hoa cho ");
                    WriteLiteral(@"cả những mẫu hoa có giá từ 100.000đ (5$) mà không có phụ phí gì thêm. Ngoài ra, các mẫu hoa tươi của chúng tôi có xác nhận bảo hành tươi tối thiểu 3 ngày trong điều kiện bình thường.</p>
                        <h3>Trở thành công ty điện hoa số 1 tại Việt Nam</h3>
                        <p class=""desc"">Với sự đầu tư nghiêm túc, shop hoa tươi Hoayeuthuong tập trung nâng cao trải nghiệm người dùng (Customer Experience) kể cả trên môi trường trực tuyến và ngoại tuyến để đem lại một dịch vụ điện hoa hoàn hảo xứng đáng trong nỗ lực trở thành công ty điện hoa số 1 tại Việt Nam.</p>
                        <h3>Cam kết dịch vụ điện hoa 100% hài lòng</h3>
                        <p class=""desc"">Với nhiều năm kinh nghiệm phục vụ trong ngành điện hoa, shop hoa tươi Hoayeuthuong.com hiểu mức độ quan trọng trong công việc của mình là truyền tải đúng và đủ thông điệp của người tặng đến người nhận. Vì thế chúng tôi cam kết 100% sự hài lòng của khách hàng với dịch vụ điện hoa của chúng tôi. Với bất cứ điều gì không hài lòng");
                    WriteLiteral(@" bạn đều được hoàn lại 100% phí dịch vụ đã chuyển cho chúng tôi.</p>
